    name: "jop",
    data(){
        return{
            type:{
                isQ:true,
                isL:false,
                isX:false,
                isC:false,
            }
        }
    },
    methods:{
        changeColor(name){
            var obj = {}
            Object.keys(this.type).forEach(ele => {
                if(ele !== name){
                    obj[ele]= false;
                }else{
                    obj[ele] = true;
                }
            })
            this.type = obj;
        }
    }
